import React from "react";
import Style from "./SkillInfo.module.css";
const SkillInfo = ({ imgSrc, info }) => {
  return (
    <div className={Style["skill_info"]}>
      <div>
        <img src={imgSrc} width="50px" height="50px"/>
      </div>
      <span></span>
      <p>{info}</p>
    </div>
  );
};

export default SkillInfo;
